import React, { useState, useEffect } from "react";
import { web3, rideSharingContract } from "../web3";

function UserDashboard() {
  const [rides, setRides] = useState([]);
  const [statusMessage, setStatusMessage] = useState("");

  // Convert the numeric status from the contract into human-readable text
  const getStatusText = (status) => {
    const numericStatus = parseInt(status, 10);
    if (numericStatus === 0) return "Not Started";
    if (numericStatus === 1) return "Ongoing";
    if (numericStatus === 2) return "Completed";
    return "Unknown";
  };

  // Load rides from the contract or insert a fallback dummy ride if none found
  const loadRides = async () => {
    console.log("Inside loadRides in UserDashboard");
    try {
      await window.ethereum.request({ method: "eth_requestAccounts" });
      console.log("Requesting rideCount in UserDashboard...");
      const rideCount = await rideSharingContract.methods.rideCount().call();
      console.log("rideCount from contract (UserDashboard):", rideCount);

      let ridesArray = [];
      for (let i = 1; i <= rideCount; i++) {
        console.log("Fetching ride at index:", i);
        const ride = await rideSharingContract.methods.rides(i).call();
        ride.amountEth = web3.utils.fromWei(ride.amount, "ether");
        ridesArray.push(ride);
      }

      // If no rides are found, add a fallback ride (Saskatoon â†’ Regina)
      if (ridesArray.length === 0) {
        console.log("No rides found on-chain; adding dummy ride.");
        ridesArray.push({
          id: "dummy",
          driver: "0x0000000000000000000000000000000000000000",
          source: "Saskatoon",
          destination: "Regina",
          seats: "1",
          amount: web3.utils.toWei("0.5", "ether"),
          amountEth: "0.5",
          status: "0", // Not Started
          user: "0x0000000000000000000000000000000000000000"
        });
      }

      console.log("Final rides array (UserDashboard):", ridesArray);
      setRides(ridesArray);
    } catch (error) {
      console.error("Error loading rides in UserDashboard:", error);
      alert("Error in loadRides (UserDashboard): " + error.message);
    }
  };

  useEffect(() => {
    loadRides();
    // Poll every 2 seconds to see newly proposed rides quickly
    const interval = setInterval(loadRides, 2000);
    return () => clearInterval(interval);
  }, []);

  // Handle selecting and paying for a ride
  const handleSelectRide = async (rideId, rideWei) => {
    try {
      console.log("Selecting ride:", rideId, "for wei:", rideWei);
      const accounts = await window.ethereum.request({ method: "eth_requestAccounts" });
      const user = accounts[0];

      await rideSharingContract.methods
        .selectRide(rideId)
        .send({ from: user, value: rideWei });

      setStatusMessage("Ride selected & paid successfully!");
      // Reload rides to see the updated status
      loadRides();
    } catch (error) {
      console.error("Error selecting ride:", error);
      setStatusMessage("Transaction failed or canceled.");
    }
  };

  // Filter rides to only show "Not Started"
  // But note that we parseInt the ride.status for comparison
  const availableRides = rides.filter((ride) => parseInt(ride.status, 10) === 0);

  return (
    <div style={{ padding: "20px" }}>
      <h2>User Dashboard - Available Rides</h2>
      <button onClick={loadRides}>Refresh Rides</button>
      {statusMessage && <p>{statusMessage}</p>}

      {availableRides.length === 0 ? (
        <p>No rides available at the moment.</p>
      ) : (
        <ul>
          {availableRides.map((ride) => (
            <li key={ride.id} style={{ marginBottom: "10px" }}>
              <div>
                <strong>Source:</strong> {ride.source} |{" "}
                <strong>Destination:</strong> {ride.destination} |{" "}
                <strong>Seats:</strong> {ride.seats} |{" "}
                <strong>Amount:</strong> {ride.amountEth} ETH |{" "}
                <strong>Status:</strong> {getStatusText(ride.status)}
              </div>
              {/* If the ride is not started, show Select & Pay */}
              {parseInt(ride.status, 10) === 0 && ride.id !== "dummy" && (
                <button onClick={() => handleSelectRide(ride.id, ride.amount)}>
                  Select & Pay
                </button>
              )}
              {/* If it's the dummy ride, we can show a message or do nothing */}
              {parseInt(ride.status, 10) === 0 && ride.id === "dummy" && (
                <button
                  onClick={() =>
                    alert("This is a dummy ride. A real on-chain ride will appear once proposed in the Driver Dashboard.")
                  }
                >
                  Dummy Ride
                </button>
              )}
            </li>
          ))}
        </ul>
      )}
      {statusMessage && <p>{statusMessage}</p>}
    </div>
  );
}

export default UserDashboard;
